import Property from '../core/property/Property';

export default class ImageSrcProp extends Property {
  static name: string = 'image-src';

  defaultValue: any[] = [
    'data:image/jpeg;base64,',
  ];
  availableValues: Record<any, any>[] = [
    {
      src: 'data:image/jpeg;base64,',
    },
  ];

  getName(): string {
    return ImageSrcProp.name;
  }

  apply() {
    this.component.specific = {
      ...this.component.specific,
      src: this.value[0],
    };
    this.component.htmlElement.src = this.value[0];
  }

  clear() {
    this.component.specific = {
      ...this.component.specific,
      src: this.defaultValue[0],
    };
    this.component.htmlElement.src = this.defaultValue[0];
  }
}
